Nice Guys Finish First (BBC Horizon television series) is a 1987 documentary by Richard Dawkins which discusses selfishness and cooperation, focusing especially on the tit for tat strategy of the prisoner's dilemma game. The film is approximately 45 minutes long and was produced by Jeremy Taylor.
